from collections import Counter
for i in range(int(input())):
    n = int(input())
    a = str(n)
    ans = []
    d = Counter(a)
    for j in range(65, 91):
        k = str(j)
        if k[0] in a and k[1] in a:
            if k[0] == k[1]:
                if d[k[0]] >= 2:
                    ans.append(j)
            else:
                ans.append(j)
    for j in range(len(ans)):
        print(chr(int(ans[j])), end='')
        if j == len(ans) - 1:
            print('')
    if len(ans) == 0:
        print('')
